import React, { Component } from "react";
import { Router } from "@reach/router";
import NotFound from "./pages/NotFound.js.js";
import NavBar from "./modules/NavBar.js.js";
import Footer from "./modules/Footer.js.js";

import "../utilities.css";
import "./App.css";

import { socket } from "../client-socket.js.js";

import { get, post } from "../utilities";
import About from "./pages/About.js.js";
import Faq from "./pages/Faq.js.js";
import Contact from "./pages/Contact.js.js";
import Facilities from "./pages/Facilities.js.js";
import Government from "./pages/Government.js.js";
import GuestList from "./modules/GuestList.js.js";

/**
 * Define the "App" component as a class.
 */
class App extends Component {
  // makes props available in this component
  constructor(props) {
    super(props);
    this.state = {
      userId: undefined,
    };
  }

  componentDidMount() {
  }

  handleLogin = (res) => {
  };

  handleLogout = () => {
  };

  render() {
    return (
      <>
      <div className="App-container">
        <NavBar/>
        <Router>
          <About 
            path="/"
          />
          <Government
            path="/government"
          />
          <Facilities
            path="/facilities"
          />
          <Faq
            path="/faq"
          />
          <Contact
            path="/contact"
          />
          <GuestList 
            path="/guestlist"
          />
          <NotFound default />
        </Router>
        <Footer />
        </div>
      </>
    );
  }
}

export default App;
